import React from "react";
import Card from "./Card";


const Amaz = () =>{

    return (    
            <Card 
            key={Ncard[2].id}
            imgscr ={Ncard[2].imgscr} 
            title = {Ncard[2].title} 
            sname = {Ncard[2].sname} 
            link = {Ncard[2].link}                 
            />
       
    );
}

export default Amaz;
